    <Switch>
        <Route>
        <Route path="/About" component={About} /> 
        <Route path="/Login" component={Login} />
        <Route path="/Register" component={Register} /> </Route>
        <Route path="/MyPage" component={MyPage} /> 
    </Switch>
);

export default Main;
